import React from 'react';
import PropTypes from 'prop-types';

import './title.scss';

const Title = ({ title }) => (
  <h1 className="title">{title}</h1>
);

Title.propTypes = {
  title: PropTypes.string,
}

Title.defaultProps = {
  title: 'Simple title',
}

export default Title;
